import React, { Component } from 'react';

class PropsCompo2 extends Component {
    render() {
        let name = this.props.name;
        let age = this.props.age;
        let addr = this.props.addr;

        return (
            <div className="PropsCompo2">
                <h3>속성을 갖는 컴포넌트</h3>
                <p>
                    name : {name}<br />
                    age  : {age}<br />
                    addr : {addr}<br />
                </p>
            </div>
        );
    }
}
export default PropsCompo2;
